import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";

import Home from "./components/Home";
import Header from "./Header";
import People from "./components/People";

function App() {
  let Component;
  switch (window.location.pathname) {
    case "/":
      Component = App
      break
    case "/components/People":
      Component = People
      break
  }
  return (
    <>
      <Header />
      <Component />
    </>
  );
}

export default App;
